  return (
    <div className={`frame-36293 ${className || ""}`}>
      <div className="frame-3531">
        <ArrowChevron_big_left2 arrowChevron_Big_Left={arrowChevron_big_left2Props.arrowChevron_Big_Left} />
        <div className="welcome-back ibmplexsans-semi-bold-quarter-spanish-white-24px">{welcomeBack}</div>
      </div>
    </div>
  );
}

export default Frame36292;
